Modern CPUs can speculatively execute instructions in a branch, before a branch true execution starts. int some_function(int user_input)
{ int x = 0; int flush_reload_buffer[256]; if (check user_input) { // on checking user_input, undo changes to x x = secret_array[user_input]; // this is executed. before check. // contents leak into the cache. } y = flush_reload_buffer[x]; leak = measure_access_time_of_all_elements(flush_reload_buffer);
} The CPU based on historic data, tries to predict branches and executes instructions in the branch. Later it checks the branch check, if the instructions it ran were incorrect, it undoes all the changes. These changes are transparent for the user. But the instructions in the branch load data into the cache. This data can then be identified by cache timing. This can be used to read data from the kernel via eBPF JIT. Users can provide eBPF bytecode which the kernel runs at certain kernel hooks. The bytecode is translated into machine code using a JIT engine. HW Solution is to clean up cache while undoing changes.
